          "description": "\"The book is to show that the aim of thinking about what to do, of practical reason, is to find, not what we ought to do, but what is a good thing to do for us under the circumstances. So it argues, first, that neither under prudence nor under morality there are things we ought to do. There is no warrant for the idea of our being required, by natural law perhaps or by our rationality, to do either what helps us attain our ends or what is right for moral reasons. While common moral understanding is committed to there being things we ought to do and to our being guilty and deserving blame if we fail to do them, we can lay aside these notions without loss, indeed with benefit. Second, it explains what it is for something to be good for somebody to do under the circumstances and argues for understanding practical reason in these terms. What is good for somebody to do we find by experience: from what we go through we learn what helps and what hinders and figure out on this basis both what is prudentially useful and what is morally right to do - although in the end this difference itself gives way, and morality turns out to be a part of prudence\"--",
